  \"2016-01-20T10:00:29.201811\",\n\t\"name\": \"hydrologic-soil-group-for-the-upper-colorado-river-basin-in-daymet-climate-data-resolution-hsg-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"hsg_UCRB_Daymet_resolution.txt is an Esri
  ASCII grid representing the hydrologic soil group (HSG) for the Upper Colorado River
  Basin. The HSG for an area is determined by the least water-transmitting layer in
  the soil column. The Natural Resources Conservation Service (NRCS) classifies four
  HSGs from Group A (high infiltration capacity and low overland flow potential) to
  Group D (low infiltration capacity and high overland flow potential). In Soil-Water
  Balance recharge simulations, a lookup table incorporates HSG and land-cover information
  for each grid cell to define unique runoff curve numbers, vegetation rooting depths,
  interception values, and maximum daily recharge values.\",\n\t\"license_title\":
